/* eslint-disable jsx-a11y/alt-text */
import image1 from '../images/image1.png'
import image2 from '../images/music-logo.png'
import React from 'react'

const P1 = () => {
    return (
        <div><div><img src={image1}></img></div>
        <div><img src={image2}></img></div></div>
    )
}

export default P1;
